import styled from 'styled-components';

export const UploadIconWrapper = styled.span`
  position: absolute;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #30c56d;
  width: 38px;
  height: 38px;
  bottom: 0;
  right: 0;
  z-index: 1;
  border: 2px solid #ffffff;
  border-radius: 19px;
  color: #ffffff;
  cursor: pointer;
`;
